    <button id="F_decrement" disabled="true" onclick="decrement('F')">-1</button><span id="F_count" display="inline">0</span><button id="F_increment" onclick="increment('F')">+1</button>Fusion Flamethrower<br>
    <button id="G_decrement" disabled="true" onclick="decrement('G')">-1</button><span id="G_count" display="inline">0</span><button id="G_increment" onclick="increment('G')">+1</button>Gluon Grenades<br>

<script id="jsbin-javascript">

var soldiers_sent = 0
var weapons = [ 'A', 'F', 'G', 'L', 'M', 'P', 'R', 'T' ]
var weapons_count = 0
var weapons_chosen = {
 'A' : 0,
 'F' : 0,
 'G': 0,
 'L' : 0,
 'M' : 0,
 'P' : 0,
 'R' : 0,
 'T' : 0,
}

function increment(weapon){
 weapons_chosen[weapon] = weapons_chosen[weapon] + 1
 span_id = weapon + '_count'
 document.getElementById(span_id).innerHTML = weapons_chosen[weapon]
 weapons_count = weapons_count + 1
 document.getElementById('soldier_count_text').innerHTML = weapons_count
 decrement_button_id = weapon + '_decrement'
 document.getElementById(decrement_button_id).disabled = false

 if( weapons_count == 10 ) {
  for(w in weapons) {
   w = weapons[w]
   increment_button_id = w + '_increment'
   console.log(increment_button_id)
   elem = document.getElementById(increment_button_id)
   console.log(elem)
   elem.disabled = true
  }
 }
}

function decrement(weapon){
 weapons_chosen[weapon] = weapons_chosen[weapon] - 1
 span_id = weapon + '_count'
 document.getElementById(span_id).innerHTML = weapons_chosen[weapon]
 weapons_count = weapons_count - 1
 document.getElementById('soldier_count_text').innerHTML = weapons_count

 if( weapons_chosen[weapon] == 0 ) {
  decrement_button_id = weapon + '_decrement'
  document.getElementById(decrement_button_id).disabled = true
 }

 if( weapons_count == 9 ) {
  for(w in weapons){
   w = weapons[w]
   increment_button_id = w + '_increment'
   document.getElementById(increment_button_id).disabled = false
  }
 }
}

function rand_array(input_array) {
 return(input_array[Math.floor(input_array.length * Math.random())])
}

function get_ending_text() {
 if(win) {
  if(weapons_count == 10) {
   return("You return alive...but Sergeant Rico is furious with you.  It emerges that, due to you requisitioning ten soldiers for this battle" +
" (far more than would usually have been sent), several other close battles were narrowly lost.  You are dishonorably discharged from the " + 
"Democratic People's Glorious Free Army, and sent back to your Class Eight Habitation Module.")
  } else if (weapons_count == 9) {
   return("You return alive...but Sergeant Rico is angry with you.  It emerges that, due to you requisitioning nine soldiers for this battle " + 
"(more than would usually have been sent), another close battle was narrowly lost.  You are assigned to a period of latrine duty that will " + 
"probably last your entire tour.")
  } else if (weapons_count == 8) {
   return("The Democratic People's Glorious Free Army considers this performance adequate. You are returned to the ranks, to earn your position within your Glorious Democratic society." )
  } else if (weapons_count == 7) {
   return("The Democratic People's Glorious Free Army is pleased by your victorious return. " + 
"Now that you've seen combat and returned, Sergeant Rico is willing to consider that there might be something to your methods, and " + 
"for the rest of your tour you're able to help make decisions using Data Science (and steer yourself to safer places).")
  } else if (weapons_count == 6) {
   return("The Democratic People's Glorious Free Army is impressed by your victorious return with such a small squad. " + 
"You are appointed to a back-line role, using your Data Science skills for the good of Democracy and Freedom " + 
"(and also serving out the rest of your tour in complete safety). From the relative luxury of your Class Four Habitation Module," + 
" you toast the wine you are entitled to as part of your Grade Five Nutrition Allotment.")
  } else if (weapons_count == 5) {
   return("The Democratic People's Glorious Free Army is extremely impressed by your victorious return.  " + 
"(Or, for that matter, your return at all).  You are awarded the People's Glorious Order of Meritorious Freedom " + 
"(second class), dubbed the Hero of Freedom Ridge, and sent on a series of morale-raising parades to boost support " + 
"for the war. From the luxury of your Class Three Habitation Module (behind only members of the Glorious People's " + 
"Democratic Party of Freedom itself), you toast the good wine you are entitled to as part of your Grade Six Nutrition Allotment.")
  } else if (weapons_count == 4) {
   return("The Democratic People's Glorious Free Army is stunned by your victorious return.  " + 
"(Or, for that matter, your return at all).  You are awarded the People's Glorious Order of Meritorious Freedom " + 
"(first class), dubbed the Lunatic Hero of Suicide Ridge, and sent on a series of morale-raising parades to boost support " + 
"for the war. From the impeccable luxury of your Class Two Habitation Module (behind only the highest-ranking members of the Glorious People's " + "Democratic Party of Freedom itself), you toast the excellent wine you are entitled to as part of your Unlimited Nutrition Allotment.")
  } else {
   throw('You cannot win with this number of soldiers?')
  }
 } else {
  if( winrate == 0 ) {
   output = "You never really believed what the Glorious Free People's Propaganda said about the Alien Menace anyway.  You arrive to battle with a woefully underequipped squad that has no chance against the aliens, and attempt to surrender.  "
   if( Math.random() < 0.5 ) {
     fate = rand_array(['swiftly dissolved into a puddle of acidic goo.', 'immediately perforated by agonizingly venomous spines.', 'voraciously devoured by a ravenous toothed maw.'])
     output = output + "Unfortunately, the aliens don't seem interested in listening.  Perhaps the People's Propaganda was accurate after all?  Or perhaps the aliens have simply lost patience with humanity?  In either case, you are " + fate
   } else {
    aliens = rand_array(['anarcho-', 'post-', 'techno-']) + rand_array(['prandialist', 'anarchist', 'syndicratic', 'technocratic'])
    output = output + "Fortunately, it seems your suspicions were correct!  The aliens gladly welcome you to their " + aliens + " utopia.  You live a happy life there, using your Data Science skills to defend their peaceful society from Earth aggression."
   }
   return(output)
  } else {
   fate = rand_array(['swiftly dissolved into a puddle of acidic goo.', 'immediately perforated by agonizingly venomous spines.', 'voraciously devoured by a ravenous toothed maw.'])
   return("Perhaps you didn't choose the right weapons to bring.  Or perhaps you were simply unlucky.  In any case, an alien is able to break through your lines, and you are " + fate)
  }
 }
}

function write_text() {
 if( win) {
  result_text = 'You survived, using ' + weapons_count + ' soldiers.'
 } else {
  result_text = 'You did not survive.'
 }
 document.getElementById('result_text').innerHTML = result_text
 document.getElementById('story_text').innerHTML = get_ending_text()
 document.getElementById('output_text').innerHTML = 'You had a ' + Math.round(winrate * 10000)/100 + '% chance of surviving.'
}

function calculate() {
 team = ''
 for(w in weapons){
  w = weapons[w]
  team = team + w.repeat(weapons_chosen[w])
 }
 winrate = winrates[team]
 if(Math.random() < winrate) {
  win = true
 } else {
  win = false
 }
 write_text()
 setup()
}

function setup() {
 document.getElementById('calc_button').innerHTML = rand_array(['For Glory!', 'For Freedom!', 'For Democracy!', 'For the People!', "For the People's Glorious Free Democratic Republic of Earth!"])
}
